import { Link } from "react-router-dom";

function Login() {
  return (
    <div style={{ padding: 40 }}>
      <h1>LOGIN PAGE</h1>

      <input placeholder="Email" />
      <br /><br />
      <input type="password" placeholder="Password" />
      <br /><br />

      <button>Login</button>

      <p>
        <Link to="/">‚Üê Back to Home</Link>
      </p>
    </div>
  );
}

export default Login;
